class Solution:
    def maxSubstringLength(self, s: str, kk: int) -> bool:
        c=[0]*26
        lss =[]
        visit ={}
        ret = 0
        n = len(s)
        
        atoz = "abcdefghijklmnopqrstuvwxyz"
        odic = {}
        for i,a in enumerate(atoz):
            odic[a] =i
        for a in s:
            c[odic[a]]+=1
        print(c)
        for a in s:
            if a not in visit:
                visit[a] = 1
                lss.append([0]*26)
            for ls in lss:
                ls[odic[a]] +=1
            for ls in lss:
                isG = True
                for k in range(26):
                    if ls[k] != c[k]:
                        isG = False
                        break
                if isG == True and sum(ls) !=n:
                    ret +=1
                    lss =[]
                    break
            #print(lss,a,ret)

        print(ret)
        return ret >=kk



